import ErrorBoundary from "../ErrorBoundary";
import "./Home.css";
import FirstSearch from "./FirstSearch";
import portada from "./components/portada.jpg";

import "./Home.css";

function Home() {
  return (
    <div className="pageHome">
      <img
        src={portada}
        style={{
          width: "100%",
        }}
        alt="Casa alquiler"
      />

      <div className="firstSearch">
        <h1 id="titulo">Encuentra tu hogar ideal</h1>
        <ErrorBoundary>
          <FirstSearch />
        </ErrorBoundary>
      </div>
    </div>
  );
}

export default Home;
